app.controller('NewsletterController', ['$scope', 'RequestService', 'ModalService', function ($scope, RequestService, ModalService) {
    $scope.subscribeToNewsletter = function(credentials) {
        if(!credentials) {
          credentials = {};
        }
        RequestService.post('newsletter/subscribe', {email: credentials.email, name: credentials.name}, function(res) {
                ModalService.openModal('info', {title: 'Success', message: 'Thank you for subscribing. Please check your emails and submit the subscription!'});
            }, function(error) {
                console.log(error);
            }
        );
    };
}]);


app.directive('dropdown',[function() {
    return {
        restrict: 'E',
        replace: true,
        scope: {
            data: '=',
            onSelect: '=',
            classSuffix: '@',
            parentItem: '='
        },
        link: function(scope, element, attrs) {
            scope.active = false;
            scope.select = {
                value: scope.data.currentItemName || scope.data.currentItemId
            };

            scope.toggleGhost = function($event) {
                $event && $event.stopPropagation();
                scope.active = !scope.active;
            };

            scope.toggleDropdown = function($event) {
                $event && $event.stopPropagation();
                scope.active = !scope.active;
            };

            scope.selectDropdownItem = function(item, $event) {
                $event.stopPropagation();

                scope.active = false;
                scope.select.value = item.title;
                if(typeof(scope.onSelect) == "function") {
                    scope.onSelect(item.id, scope.parentItem);
                }
            }
        },
        templateUrl: function(elem,attrs) {
            return 'partials/dropdown/' + attrs.templateName + '.html';
        }
    }
}]);
app.directive('dropzone',['RequestService', function(RequestService) {
    return {
        restrict: 'E',
        templateUrl: 'partials/dropzone.html',
        replace: true,
        scope: {
            uploadData: '=',
            uploadSettings: '='
        },
        link: function(scope, element) {

            element.bind("dragenter", function() {
                element.addClass('hover');
            });

            element.bind("dragleave", function() {
                element.removeClass('hover');
            });

            RequestService.upload(scope, element);
        }
    }
}]);
